import React from 'react';

// Define the styles
const containerStyle = {
  display: 'grid',
  gridTemplateColumns: 'repeat(auto-fit, minmax(250px, 1fr))',
  gap: '1.5rem',
  padding: '2rem',
};

const skillsSectionStyle = {
  background: 'linear-gradient(145deg, #ffffff, #f5f5f5)',
  borderRadius: '12px',
  boxShadow: '0px 10px 20px rgba(0, 0, 0, 0.1)',
  padding: '1.5rem',
  textAlign: 'center',
};

const sectionTitleStyle = {
  fontSize: '1.8rem',
  fontWeight: '600',
  marginBottom: '1rem',
  color: '#333',
};

const badgeStyle = {
  margin: '5px',
  display: 'inline-block',
  transition: 'transform 0.3s, box-shadow 0.3s',
  cursor: 'pointer',
};

const Skills = () => {
  const renderBadges = (skills, colors) => {
    return skills.map(skill => (
      <img
        key={skill}
        src={`https://img.shields.io/badge/-${skill}-${colors[skill].slice(1)}?style=flat&logo=${skill.toLowerCase().replace('.', '-')}&logoColor=white`}
        alt={skill}
        style={{
          ...badgeStyle,
          filter: 'brightness(1.2)', // Slightly brighter badges
          boxShadow: `0 0 10px ${colors[skill]}`, // Shadow matching badge color
        }}
        onMouseOver={(e) => {
          e.currentTarget.style.boxShadow = '0 0 20px rgba(255, 255, 255, 0.7)'; // Bright glow on hover
          e.currentTarget.style.transform = 'scale(1.1)'; // Slightly larger on hover
        }}
        onMouseOut={(e) => {
          e.currentTarget.style.boxShadow = `0 0 10px ${colors[skill]}`; // Restore shadow color
          e.currentTarget.style.transform = 'scale(1)'; // Reset scale
        }}
      />
    ));
  };

  return (
    <section id="Skills" style={{ padding: '4rem', backgroundColor: '#e8f5e9' }}>
      <div style={{ maxWidth: '1200px', margin: '0 auto' }}>
        <h2 style={{ textAlign: 'center', fontSize: '2.5rem', fontWeight: '700', marginBottom: '2rem', color: '#007396' }}>
          Skills & Expertise
        </h2>

        <div style={containerStyle}>
          {/* Frontend Section */}
          <div style={{ ...skillsSectionStyle, backgroundColor: '#1c1c1c', padding: '20px' }}>
            <h3 style={{ ...sectionTitleStyle, color: '#ffcc00', textShadow: '2px 2px 4px rgba(0, 0, 0, 0.8)' }}>
              Frontend
            </h3>
            <div style={{ display: 'flex', flexWrap: 'wrap', justifyContent: 'center' }}>
              {renderBadges(['JavaScript', 'HTML5', 'CSS3', 'React'], {
                JavaScript: '#f7df1e',
                HTML5: '#e34f26',
                CSS3: '#1572b6',
                React: '#61dafb',
              })}
            </div>
          </div>

          {/* Backend Section */}
          <div style={{ ...skillsSectionStyle, backgroundColor: '#282c34', padding: '20px' }}>
            <h3 style={{ ...sectionTitleStyle, color: '#61dafb', textShadow: '2px 2px 4px rgba(0, 0, 0, 0.8)' }}>
              Backend
            </h3>
            <div style={{ display: 'flex', flexWrap: 'wrap', justifyContent: 'center' }}>
              {renderBadges(['Java', 'Node.js', 'CSharp', 'C++'], {
                Java: '#007396',
                'Node.js': '#8CC84B',
                CSharp: '#68217A',
                'C++': '#00599C',
              })}
            </div>
          </div>

          {/* MERN Stack Section */}
          <div style={skillsSectionStyle}>
            <h3 style={sectionTitleStyle}>MERN Stack</h3>
            <div style={{ display: 'flex', flexWrap: 'wrap', justifyContent: 'center' }}>
              {renderBadges(['MongoDB', 'Express.js', 'React', 'Node.js'], {
                MongoDB: '#47A248',
                'Express.js': '#000000',
                React: '#61DAFB',
                'Node.js': '#8CC84B',
              })}
            </div>
          </div>

          {/* Testing Section */}
          <div style={{ ...skillsSectionStyle, backgroundColor: '#f0f0f0' }}>
            <h3 style={{ ...sectionTitleStyle, color: '#4A4A4A' }}>
              Testing
            </h3>
            <div style={{ display: 'flex', flexWrap: 'wrap', justifyContent: 'center' }}>
              {renderBadges(['Selenium', 'JUnit'], {
                Selenium: '#43B02A',
                JUnit: '#FFAE42',
              })}
            </div>
          </div>

          {/* Additional Section */}
          <div style={{ ...skillsSectionStyle, backgroundColor: '#e8f0fe' }}>
            <h3 style={{ ...sectionTitleStyle, color: '#3D3D3D' }}>
              Additional Skills
            </h3>
            <div style={{ display: 'flex', flexWrap: 'wrap', justifyContent: 'center' }}>
              {renderBadges(['Docker', 'Kubernetes'], {
                Docker: '#2496ED',
                Kubernetes: '#326CE5',
              })}
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Skills;
